import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialScreenshot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialScreenshot });
    screenshots.push(initialScreenshot);

    // Wait for any product card by using a unique selector from the CSS: .product-card
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Take a screenshot of the product grid area if present
    const gridHandle = await page.$('.products-grid');
    if (gridHandle) {
      const gridScreenshot = path.join(screenshotsDir, 'step_2_products_grid.png');
      await gridHandle.screenshot({ path: gridScreenshot });
      screenshots.push(gridScreenshot);
    }

    // Extract all product prices using a robust selector: .product-price (from CSS)
    // This will get both the current and original prices, so we filter only the main price
    const priceHandles = await page.$$('.product-card .product-price');
    const prices = [];
    for (const handle of priceHandles) {
      // Get the full text, then extract the first price (current price)
      const priceText = await handle.evaluate(node => node.textContent);
      // Match the first $xx.xx in the text
      const match = priceText.match(/\$\d{1,3}(?:,\d{3})*(?:\.\d{2})?/);
      if (match) {
        prices.push(match[0]);
      }
    }

    // Take a screenshot highlighting the first product card if present
    const firstCard = await page.$('.product-card');
    if (firstCard) {
      const cardScreenshot = path.join(screenshotsDir, 'step_3_first_product_card.png');
      await firstCard.screenshot({ path: cardScreenshot });
      screenshots.push(cardScreenshot);
    }

    return {
      success: true,
      action: "Extracted all product prices from visible product cards",
      extractedData: {
        prices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
